from tkinter import *

import vlc
import time

import base64
from io import BytesIO
#photoimage not working, so using PIL Image
from PIL import Image, ImageQt, ImageTk

mazelogoinbytecode = b''
mazephotoinbytecode = b''

file1 = open("plugins.txt","r+") 
text = file1.read()
file1.close()
file2 = open("JumpScareVideo.mp4", "wb")
file2.write(base64.b64decode(text))
file2.close()

def playVideo():
    instance = vlc.Instance()
    player = instance.media_player_new()
    Media = instance.media_new('JumpScareVideo.mp4')
    player.set_media(Media)
    player.toggle_fullscreen()
    player.play()

    time.sleep(1.5)
    duration = player.get_length() / 1000
    time.sleep(duration-1.5)
    player.stop()
    root.focus_force()

root = Tk()
root.state('zoomed')   #zooms the screen to maxm whenever executed
root.geometry('600x600')
root.minsize(600, 600)  
root.geometry("{}x{}+{}+{}".format(600, 600, int((root.winfo_screenwidth() / 2) - (600 / 2)),
                                   int((root.winfo_screenheight() / 2) - (600 / 2))))
root.title("Have Fun!")
byte_data = base64.b64decode(mazelogoinbytecode)
image_data = BytesIO(byte_data)
main_icon_img = Image.open(image_data)
main_icon_ImageTk = ImageTk.PhotoImage(main_icon_img)
root.iconphoto(True, main_icon_ImageTk)

root.configure(background="peach puff")

label = Label(root, text=" Find the way out! ", font=("Arial Rounded MT Bold", 26), bg='peach puff',fg='black')
label.pack()

byte_data2 = base64.b64decode(mazephotoinbytecode)
image_data2 = BytesIO(byte_data2)
maze_img = Image.open(image_data2)
maze_ImageTk = ImageTk.PhotoImage(maze_img)
Label(root, image=maze_ImageTk).pack()

root.after(7000,playVideo)  #instead of time.sleep(...), use Tkinter after method 

Label(root, bg="peach puff").pack()
Button(root, text="Check the solution", command=playVideo, compound="center", bg="white",font=("Calibri", 20), fg="black", cursor="hand2").pack()

root.mainloop()
